// HomePage.js
import React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

const HomePage = () => {
  return (
    <Box sx={{ position: 'relative', minHeight: '100vh' }}>
      {/* Catchy text on the left */}
      <Box
        sx={{
          position: 'absolute',
          top: '50%',
          left: '5%',
          transform: 'translateY(-50%)',
          textAlign: 'left',
          width: '40%',
          color: 'white',
        }}
      >
        <Typography variant='h3' fontWeight={700} fontFamily='monospace'>
          Elevate Your Designs with Design Boost
        </Typography>
        <Typography variant='subtitle1' mt={2}>
          Unleash the power of stunning and user-friendly interfaces.
        </Typography>
      </Box>

      {/* Half circle with gradient background on the right */}
      <Box
        sx={{
          position: 'absolute',
          top: 0,
          right: 0,
          width: '50%',
          height: '100%',
          background: 'linear-gradient(to bottom, #311b92, #000000)',
          clipPath: 'ellipse(100% 50% at 0% 0%)',
        }}
      />
    </Box>
  );
};

export default HomePage;
